import React from "react";
import './LeftNav.css';
import linked from '../src/assets/left-nav-linkedin-link.png';
import gitHub from '../src/assets/left-nav-git-link.png';
import insta from '../src/assets/left-nav-insta-link.png';
import blackJack from '../src/assets/left-nav-blackjack-link.png';
import dice from '../src/assets/left-nav-dice-link.png';
import logo from '../src/assets/logo.png'


export default function LeftNav() {
    return (
        <div className="left-nav-container">
            <a id='logo' href="#" target="#"><img  src="../assets/logo.png" alt="logo" width="50px" /></a>
            <div class="left-nav-social-links">
            <div id="left-nav-one" class="left-nav-links"><a href="../https://www.linkedin.com/in/trevor-sykes-717585136/" target="_blank"><img class="left-nav-links-img" src={linked} alt="" /></a></div>
            <div id="left-nav-two" class="left-nav-links"><a href="../https://github.com/trevarious" target="_blank"><img class="left-nav-links-img" src={gitHub} alt="" /></a></div>
            <div id="left-nav-three" class="left-nav-links"><a href="../https://instagram.com"><img class="left-nav-links-img" src={insta} alt="" /></a></div>
            <div id="left-nav-four"><a href="https://instagram.com"><img class="left-nav-links-img" src={dice} alt="" /></a></div>
            <div id="left-nav-five"><a href="https://instagram.com"><img class="left-nav-links-img" src={blackJack} alt="" /></a></div>
        </div>
        </div>
    )
}
